  );

CREATE TABLE sales (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    client_id INTEGER NOT NULL,
    representative_id INTEGER NOT NULL,
    pack_id INTEGER NOT NULL,
    total_price DECIMAL(10,2) NOT NULL,
